import React from "react";

const Selected_ItemList = props => {
  return (
    <tr style={{ textAlign: "center" }}>
      <td>{props.item.name}</td>
      <td>
        <h6 style={{ fontSize: 13, marginTop: 0, marginBottom: 0 }}>
          Requirement
        </h6>
        <input
          className="col s6"
          type="number"
          id={props.item.id}
          value={props.item.req}
          onChange={props.change}
        />
      </td>
      <td>
        <h6 style={{ fontSize: 13, marginTop: 0, marginBottom: 0 }}>Price</h6>
        <input
          className="col s6 offset-s1"
          type="number"
          value={props.item.totPrice}
          onChange={props.change}
          disabled
        />
      </td>
    </tr>
  );
};

export default Selected_ItemList;
